import React, { Component } from 'react';

export default class Api extends Component {
    constructor(props) {
        super(props);
        this.url = 'https://randomuser.me/api/?results=10';

        this.state = {
            data: {},
        };
    }

    componentDidMount() {}

    getData() {
        fetch(this.url)
            .then(data => data.json())
            .then(res => {
                this.setState({
                    data: res,
                });
            })
            .catch(error => console.log(error));
    }

    render() {
        console.log(this.state.data);
        return <p></p>;
    }
}
